define({"topics" : [{"title":"Default Stream","shortdesc":"\n               <p class=\"shortdesc\">The default stream captures records that do not match user-defined conditions. Use the   default stream to manage unmatched\n                  records. \n               </p>\n            ","id":"concept_xr4_zt3_3r","href":"datacollector\/UserGuide\/Processors\/StreamSelector.html#concept_xr4_zt3_3r","menu": {"hasChildren":false,},"tocID":"concept_xr4_zt3_3r-d46e73634","topics":[]},{"title":"Sample Conditions for Streams","shortdesc":"\n               <p class=\"shortdesc\">A condition defines the data that passes to the associated stream. All records that meet   the condition pass to the stream.\n                  Use the expression language to define conditions. \n               </p>\n            ","id":"concept_oy4_tbf_cr","href":"datacollector\/UserGuide\/Processors\/StreamSelector.html#concept_oy4_tbf_cr","menu": {"hasChildren":false,},"tocID":"concept_oy4_tbf_cr-d46e73659","topics":[]},{"title":"Configuring the Stream Selector","id":"task_iss_2zx_wq","href":"datacollector\/UserGuide\/Processors\/StreamSelector.html#task_iss_2zx_wq","menu": {"hasChildren":false,},"tocID":"task_iss_2zx_wq-d46e73694","topics":[]}]});